// Dependencies
import React from 'react'

const About = () => (
    <div>
        <h1> About Page </h1>
        <img src="/static/fsociety.png" alt="fsociety"/>

        <style jsx>
            {`
                img {
                    max-width: 50%;
                    display: block;
                    margin: 0 auto;
                }
            `}
        </style>

        <style jsx global>
            {`
                body {
                    background: #82A1B1
                }
            `}
        </style>
    </div>
);

export default About
